@montana_joe_carter が音源を発表してからずっと聞いてきました。
自分らの世代からすると『日本語ラップはここまで進化してるんだな』という感覚を持たせてくれるセンスがありました。

不穏でダーク、生々しいリアルさを醸し出していたダーティーなラップはただ一言クールでした。

しかし Life Game という曲で見えたある種のポップさも巧みで益々モンタナ君のラップには惹かれていきます。

そして LORD という曲では以前とは全く違ったポップさとも違うオーガニックな独白の様な内面を出すアプローチでラップをし、最初期の不穏さとは別物の厚みを持った言葉に変わっていました。

そのスタイルの変化をどう取るかはリスナーそれぞれに意見があるでしょう。

個人的には楽曲で様々なアプローチを見せてくれる表現法は素晴らしく感じています。

今回の新曲はそういったアプローチの集大成とも言えるアコースティックで歌唱的なラップには驚きました。

彼の中で何かが変化したのかと感じているのですが、その変化は良い方向に思えて仕方ありません。

『この歌が君に届くか分からないけど、ほら歌うよ。
空っぽの思い出のカケラ、この胸に抱きしめ』
この歌い出しにはヤラれましたね。

このリリックはリアルです。
自分も後ろ暗い過去を背負う人生ですが、内面では今でも色々と思う所があります。
そういった事を噛み締めさせてくれる雰囲気がこの曲にはあります。

是非とも多くのラップリスナーにそういったリアルさも聞いて欲しいと感じました。

最後にモンタナ君が新曲についてTwitterで呟かれてた事を引用させてもらいます。

